import React, {FC} from 'react';
import {Card, CardActions, Container, CardContent, Typography, Button} from '@mui/material';

import {TeamMember} from "../BoxPreview";

interface BoxTeamProps {
    leader?: string;
    members?: TeamMember[],
    title: string;
    total?: number;
}
export const BoxTeamPreview: FC<BoxTeamProps> = (props) => {
    return (
        <Container>
            <Card>
                <CardContent>
                    <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
                        Word of the Day
                    </Typography>
                    <Typography variant="h5" component="div">
                        be{bull}nev{bull}o{bull}lent
                    </Typography>
                    <Typography sx={{ mb: 1.5 }} color="text.secondary">
                        adjective
                    </Typography>
                    <Typography variant="body2">
                        well meaning and kindly.
                        <br />
                        {'"a benevolent smile"'}
                    </Typography>
                </CardContent>
                <CardActions>
                    <Button size="small">Learn More</Button>
                </CardActions>
            </Card>
        </Container>
    );
}
